import React from "react";
import NotificationsActiveIcon from '@material-ui/icons/NotificationsActive';
import { NavLink } from "react-router-dom";

const Notice = () => {

    return(
        <>
<section>
            <div  id="notice" className="container-fluid" >
                <div className="notice bg-dark">
            <a href="https://www.bitsindri.ac.in" className=" text-white text-decoration-none" > 
            <p className="animation"> for latest announcement and notices, click here...
            <NotificationsActiveIcon /> </p> </a>
            </div>
            </div>
            <br/><br/>
         </section>

        </>
    );
};

export default Notice;
